import React from "react";

const Home = () => {
  return (
    <div>
        <div className="card mx-5 my-5">
        <div className="card-header">
          Welcome to Ecovia Store
        </div>
        <div className="card-body">
          <h5 className="card-title">About this Store</h5>
          <p className="card-text">With supporting text below as a natural lead-in to additional content.</p>

          <h5 className="card-title">GitHub Link</h5>
          <p className="card-text">Developed by Manish Pritmani</p>
          <a href="#" className="btn btn-success">Show GitHub Repo</a>
        </div>
      </div>
    </div>
  );
};

export default Home;
